    private void jTextField48CaretUpdate(javax.swing.event.CaretEvent evt) {//GEN-FIRST:event_jTextField48CaretUpdate
        if(jTextField48.getText().equals(""))
                jLabel42.setText("");
        else if(jTextField48.getText().equals("szaman")) {
            jLabel42.setText("Login zajęty");
            jLabel42.setForeground(new Color(255, 0, 0));
        }
        else {
            jLabel42.setText("Login wolny");
            jLabel42.setForeground(new Color(0, 127, 0));
        }
    }//GEN-LAST:event_jTextField48CaretUpdate

